import React from 'react';
import PropTypes from 'prop-types';
import styles from './selectMonth.scss';


/**
 * General component description in JSDoc format. Markdown is *supported*.
 */
const SelectMonth = ( { optionsState } ) => (
    <label>
        <select className={styles.select} value={optionsState}>
            <option value="0"></option>
            <option value="1"></option>
            <option value="2"></option>
            <option value="3"></option>
            <option value="4"></option>
            <option value="5"></option>
            <option value="6"></option>
            <option value="7"></option>
            <option value="8"></option>
            <option value="9"></option>
            <option value="10"></option>
            <option value="11"></option>
        </select>
    </label>
);

SelectMonth.propTypes = {
    /** Description of prop "text". */

    optionsState: PropTypes.string
};

SelectMonth.defaultProps = {
    text: 'defaultText'
};

export default SelectMonth;
